import './App.css';
import Footer from './components/Footer';
import HeroSection from './components/Hero';
import Header from './components/NavBar';
import TeamSection from './components/TeamSection';

function App() {
  return (
    <div className="App">

       <Header/>
       <main id='main'>
          <HeroSection/>
          <TeamSection/>
          <Footer/>

       </main>


    </div>
  );
}

export default App;
